import React from 'react';
import GlobalStyle from './globalStyle';
import Main from './screen/main';
import {BrowserRouter, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <>
    <GlobalStyle/>
    <BrowserRouter>
        <Route exact path='/' >
            <Main />
        </Route>
        <Route exact path='/create' >
            <Main />
        </Route>
    </BrowserRouter>
    </>
  );
}

export default App;
